import React, {useState, useEffect} from 'react';
import clsx from 'clsx';
import {makeStyles} from '@material-ui/core/styles'
import GridAdSellLeases from '../../../components/GridList/GridAdSellLeases'

interface ListAdProps {
    className ?: string,
    list_ad: AdProps[],
}

interface AdProps  {
    node: {
        title: string,
        slug: string,
        created_at: string,
        updated_at: string,
        price: {
          unit: string
          value: string
        },
        avatar: {
          alt_text: string
          src: string
          description: string
        },
        address: {
          text: string,
          ward: string,
          district: string,
          city: string
        },
        contact: {
          image: string,
          name: string,
          address: string,
          mobile: string,
          phone: string,
          email: string,
        }
        area: {
          unit: string
          value: string
        }
    },
}

const useStyles = makeStyles(theme => ({
    root: {},
    posts: {
        marginTop: theme.spacing(2)
    },
    post: {
        marginBottom: theme.spacing(2)
    }
}));

interface PostType {
    id: any,
    author:{
        name:string,
        avatar:string,

    },
    created_at:string,
    message:string,
    media:string,
    avatar:string,
    name:string,
    comments:{
        id:any,
        author:{
            avatar:string,
            name:string
        }
        created_at:string,
        message:string,
    }[],
    liked:boolean,
    likes:number,
}

const Ad: React.FunctionComponent<ListAdProps> = (props: ListAdProps) => {
    const { className, ...rest } = props;
    const classes = useStyles();
    return (
        <div {...rest} className={clsx(classes.root, className)}>
            <GridAdSellLeases 
              grid={{xl: 3, lg: 3, md: 4, sm: 6, xs:12}} 
              gridData={props.list_ad} 
              typeView={"grid"}
              className="grid__list"
            />
        </div>
    );
};


export default Ad;
